import Header from "../components/Header";
import React from 'react';
import axios from 'axios';
import { useState, useEffect } from 'react';
import { useForm } from 'react-hook-form';

function Register(){
    const [apiError, setApiError] = useState(null);
    const {
        handleSubmit,
    } = useForm();

    const onSubmit = async (form_data) => {
        const name = ('#name').val();
        const email = ('#email').val();
        const phone_number = ('#phone_number').val();
        const designation = ('#designation').val();
        const pid = ('#pid').val();
        const password = ('#password').val();
        console.log(name);
        try {
            const { data } = await axios({
                method: 'post',
                url: 'http://localhost:8080/api/v1/users/saveUser',
                data: JSON.stringify({
                    "name":name,
                    "email":email,
                    "phone_number":phone_number,
                    "designation":designation,
                    "pid":pid,
                    "password":password
                })
            });
            console.log(data.meta.status);

        }
        catch (err) {
            setApiError('Some error occured during registration');
            //  console.log('Some error occured during signing in: ', err);
        }
    };
    return(
        <React.Fragment>
           <Header />
        <div class="container">
        <div class="box form-box">
        <header>Sign Up</header>
        <form>
                <div class="field input">
                    <label for="username">Username</label>
                    <input type="text" name="name" id="name" autocomplete="off" required></input>
                </div>

                <div class="field input">
                    <label for="email">Email</label>
                    <input type="text" name="email" id="email" autocomplete="off" required></input>
                </div>
                <div class="field input">
                    <label for="email">Phone Number</label>
                    <input type="text" name="phone_number" id="phone_number" autocomplete="off" required></input>
                </div>

                <div class="field input">
                    <label for="email">Designation</label>
                    <input type="text" name="designation" id="designation" autocomplete="off" required></input>
                </div>
                <div class="field input">
                    <label for="email">Fedex ID</label>
                    <input type="text" name="pid" id="pid" autocomplete="off" required></input>
                </div>
                <div class="field input">
                    <label for="password">Password</label>
                    <input type="password" name="password" id="password" autocomplete="off" required></input>
                </div>

                <div class="field">

                    <input type="submit" class="btn" name="submit" value="Register" required></input>
                </div>
                <div class="links">
                    Already a member? <a href="index.php">Sign In</a>
                </div>
            </form>
        </div>
      </div>
      </React.Fragment>
    )

}
export default Register;
